'use client';

import { useState } from 'react';
import { Button } from '@mantine/core';

export default function TestPage() {
  const [pdfUrl, setPdfUrl] = useState<string | null>(null);

  async function sendPdf() {
    const res = await fetch('/api/eazytrademe', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({
        pdfBase64: '', // Replace with actual base64
        qrData: 'https://example.com/my-link',
        targetApiUrl: 'abc',
      }),
    });

    const data = await res.json();
    console.log(data);

    if (data.updatedPdfBase64) {
      const blob = base64ToBlob(data.updatedPdfBase64, 'application/pdf');
      const url = URL.createObjectURL(blob);
      setPdfUrl(url);
    }
  }

  function base64ToBlob(base64: string, mimeType: string) {
    const byteChars = atob(base64);
    const byteNumbers = new Array(byteChars.length);
    for (let i = 0; i < byteChars.length; i++) {
      byteNumbers[i] = byteChars.charCodeAt(i);
    }
    const byteArray = new Uint8Array(byteNumbers);
    return new Blob([byteArray], { type: mimeType });
  }

  return (
    <div style={{ padding: 20 }}>
      <Button onClick={sendPdf}>Click to send</Button>
      {pdfUrl && (
        <div style={{ marginTop: 20 }}>
          <a href={pdfUrl} download="updated.pdf">
            Download Updated PDF
          </a>
        </div>
      )}
    </div>
  );
}
